    else
      col_contention = 1'b0;
  end
  endfunction

  function is_contention;
    input [4:0] aa;
    input [4:0] ab;
    input [127:0] wena;
    input [127:0] wenb;
    reg result;
  begin
    if ((& wena) === 1'b1 && (& wenb) === 1'b1) begin
